define({"topics" : [{"title":"Add a Conference","shortdesc":"\n               <p class=\"shortdesc\">To make a conference call, you should add a conference on the PBX first.</p>\n            ","id":"task_rzf_mw1_wdb","href":"topic\/add_a_conference_2.html","menu": {"hasChildren":false,},"tocID":"task_rzf_mw1_wdb-d46e21146","topics":[]},{"title":"Add Contacts on Conference Panel","shortdesc":"\n               <p class=\"shortdesc\">You can add groups of contacts on the conference panel, and select a desired group of         contacts to invite them to a\n                  conference. Contact groups will help you invite conference         members efficiently.\n               </p>\n            ","id":"task_ard_hz1_wdb","href":"topic\/add_contacts_on_conference_panel.html","menu": {"hasChildren":false,},"tocID":"task_ard_hz1_wdb-d46e21219","topics":[]},{"title":"Invite Contacts on Conference Panel","shortdesc":"\n               <p class=\"shortdesc\">You can invite contacts to join a conference on the Conference Panel.</p>\n            ","id":"task_vrd_mdb_wdb","href":"topic\/invite_contacts_on_conference_panel.html","menu": {"hasChildren":false,},"tocID":"task_vrd_mdb_wdb-d46e21292","topics":[]},{"title":"Operations on Conference Panel","shortdesc":"\n               <p class=\"shortdesc\">During the conference, you can manage the conference on the Conference         Panel.</p>\n            ","id":"concept_ssx_13b_wdb","href":"topic\/operations_on_conference_panel.html","menu": {"hasChildren":false,},"tocID":"concept_ssx_13b_wdb-d46e21365","topics":[]}]});